/* MIC BUTTON */
#microphone-button {  
}

/* Only apply hover effects on devices that support hover */
@media (hover: hover) {
  #microphone-button:hover {
    background-color: #636363;
    transform: scale(1.05);
    -webkit-transform: scale(1.05);
    transform-origin: center;
  }
}

#microphone-button:active {
  background-color: #444444;
  transform: scale(1);
  -webkit-transform: scale(1);
  transform-origin: center;
}

#microphone-button.recording {
  background-color: #ff4136; /* Red color for recording */
  transition: background-color 0.3s ease;
}

@keyframes pulse {
    0% {
      transform: scale(1);
    }
    50% {
      transform: scale(1.1);
    }
    100% {
      transform: scale(1);
    }
  }

.mic-pulse {
  animation: pulse 1.5s infinite;
}


.mic-inactive{
    background-color: grey;
}

.mic-activating{
    background-color: silver;
    animation: pulse 0.8s infinite;
}

.mic-listening {
  background-color: red;
}

.mic-recording {
  background-color: green;
}

.mic-waiting {
  background-color: teal;
}

.mic-processing {
  background-color: darkcyan;
  animation: pulse 0.8s infinite;
  transform-origin: center;
}

#toast {
  position: relative;
  width: 100%;
  background-color: #333;
  font-family: "Rubik", Arial, Helvetica, sans-serif;
  color: #fff;
  padding: 0.6rem 0.9rem;
  box-shadow: 0 2px 8px rgba(0, 0, 0, 0.15);
  display: none;
  align-items: center;
  z-index: 1000;
  transform: translateY(100%);
  transition: transform 0.4s cubic-bezier(0.19, 0.86, 0.47, 1), background-color 0.3s ease;
  will-change: transform;
}

.toast__content {
  display: flex;
  flex-direction: column;
  flex-grow: 1;
  margin-left: var(--spacing-xs);
  margin-right: 16px;
}

.toast__title {
  font-size: 0.6rem;
  color: #fff;
  opacity: 0.7;
  margin-bottom: 0.3rem;
}

.toast__separator {
  height: 1px;
  background: rgba(255, 255, 255, 0.15);
  margin-bottom: 0.3rem;
}

.toast__message {
  margin: 0;
  /* max-width: 320px; */
  text-overflow: ellipsis !important;
}

#toast.show {
  display: flex;
  transform: translateY(0);
}

#toast.hide {
  transform: translateY(100%);
}

#toast.toast--success {
  background-color: #4CAF50;
}

#toast.toast--error {
  background-color: #731811;
}

#toast.toast--info {
  background-color: #2196F3;
}

.toast__close,
.toast__copy {
  background-color: transparent;
  border: none;
  font-family: "Rubik", Arial, Helvetica, sans-serif;
  color: #fff;
  cursor: pointer;
  font-size: 16px;
  margin-left: 8px;
  opacity: 0.8;
  transition: opacity 0.2s ease;
}

.toast__close:hover,
.toast__copy:hover {
  opacity: 1;
}

/* Animations */

@keyframes toastIn {
  from {
      transform: translateY(100%);
  }
  to {
      transform: translateY(0);
  }
}

@keyframes toastOut {
  from {
      transform: translateY(0);
  }
  to {
      transform: translateY(100%);
  }
}

/* Tunnel Modal Styles */
.tunnel-container {
    padding: 1rem;
    width: 100%;
}

.tunnel-description {
    margin-bottom: 1.5rem;
    text-align: center;
}

.tunnel-actions {
    display: flex;
    justify-content: center;
    margin-top: 2rem;
    margin-bottom: 2rem;
}

.tunnel-link-container {
    margin-top: 1rem;
}

.tunnel-link-field {
    display: flex;
    align-items: center;
    margin-bottom: 0.5rem;
    background-color: var(--bg-color-secondary);
    border: 1px solid var(--border-color);
    border-radius: 4px;
}

.tunnel-link-input {
    flex: 1;
    padding: 0.75rem;
    background-color: transparent;
    border: none;
    color: var(--text-color);
    font-size: 0.9rem;
    outline: none;
}

.copy-link-button {
    padding: 0.5rem 0.75rem;
    background: none;
    border: none;
    border-left: 1px solid var(--border-color);
    color: var(--text-color);
    cursor: pointer;
    transition: background-color 0.2s;
}

.copy-link-button:hover {
    background-color: var(--bg-color-tertiary);
}

.copy-link-button i, 
.refresh-link-button i,
.btn i {
    margin-right: 6px;
}

.tunnel-link-info {
    margin-top: 1rem;
    font-size: 1rem;
    color: var(--text-color);
    text-align: center;
    line-height: 1.5;
}

.loading-spinner {
    display: flex;
    justify-content: center;
    align-items: center;
    margin-top: 2rem;
    margin-bottom: 2rem;
    min-height: 38px;
    font-style: italic;
    color: var(--text-color-secondary);
}

.loading-spinner i {
    font-size: 1.5rem;
    margin-right: 10px;
    color: var(--accent-color);
}

.refresh-link-button {
    padding: 0.5rem 0.75rem;
    background: none;
    border: none;
    border-left: 1px solid var(--border-color);
    color: var(--text-color);
    cursor: pointer;
    transition: background-color 0.2s;
}

.refresh-link-button:hover {
    background-color: var(--bg-color-tertiary);
    color: var(--accent-color);
}

.tunnel-link-persistence {
    margin-top: 0.75rem;
    font-size: 0.95rem;
    color: rgba(255, 255, 255, 0.7);
    text-align: center;
    font-style: italic;
}

.btn-danger {
    background-color: #dc3545;
    color: white;
    border: none;
}

.btn-danger:hover {
    background-color: #bd2130;
}

.stop-tunnel-container {
    margin-top: 20px;
    display: flex;
    justify-content: center;
}

/* Section title icon styling */
.section-title i {
    margin-right: 8px;
}

/* Copy button states */
.copy-success {
    background-color: rgba(40, 167, 69, 0.15) !important;
    color: #28a745 !important;
    border-left: 1px solid rgba(40, 167, 69, 0.5) !important;
    transition: all 0.3s ease-in-out;
}

.copy-error {
    background-color: rgba(220, 53, 69, 0.15) !important;
    color: #dc3545 !important;
    border-left: 1px solid rgba(220, 53, 69, 0.5) !important;
    transition: all 0.3s ease-in-out;
}

/* Animation for copy button */
@keyframes pulse {
    0% { transform: scale(1); }
    50% { transform: scale(1.05); }
    100% { transform: scale(1); }
}

.copy-success, .copy-error {
    animation: pulse 0.5s;
}

/* Refresh button state */
.refreshing {
    opacity: 0.7;
    pointer-events: none;
    background-color: rgba(108, 117, 125, 0.15) !important;
    border-left: 1px solid rgba(108, 117, 125, 0.5) !important;
}

/* Create and Stop button states */
.creating, .stopping {
    opacity: 0.8;
    pointer-events: none;
    cursor: not-allowed;
}

.creating {
    background-color: rgba(0, 123, 255, 0.7) !important;
}

.stopping {
    background-color: rgba(220, 53, 69, 0.7) !important;
}

@import url('https://fonts.googleapis.com/css2?family=Roboto+Mono:ital,wght@0,100..700;1,100..700&family=Rubik:ital,wght@0,300..900;1,300..900&display=swap');

/* Add box-sizing globally for better cross-browser consistency */
*, *::before, *::after {
  box-sizing: border-box;
}

:root {
  /* Dark mode */
  --color-background-dark: #131313;
  --color-text-dark: #d4d4d4;
  --color-primary-dark: #737a81;
  --color-secondary-dark: #656565;
  --color-accent-dark: #cf6679;
  --color-message-bg-dark: #2d2d2d;
  --color-message-text-dark: #e0e0e0;
  --color-panel-dark: #171717;
  --color-border-dark: #444444a8;
  --color-input-dark: #131313;
  --color-input-focus-dark: #101010;

  /* Light mode */
  --color-background-light: #dbdbdb;
  --color-text-light: #333333;
  --color-primary-light: #384653;
  --color-secondary-light: #e8eaf6;
  --color-accent-light: #b00020;
  --color-message-bg-light: #ffffff;
  --color-message-text-light: #333333;
  --color-panel-light: #f0f0f0;
  --color-border-light: #e0e0e0c7;
  --color-input-light: #e4e4e4;
  --color-input-focus-light: #dadada;

  /* Default to dark mode */
  --color-background: var(--color-background-dark);
  --color-text: var(--color-text-dark);
  --color-primary: var(--color-primary-dark);
  --color-secondary: var(--color-secondary-dark);
  --color-accent: var(--color-accent-dark);
  --color-message-bg: var(--color-message-bg-dark);
  --color-message-text: var(--color-message-text-dark);
  --color-panel: var(--color-panel-dark);
  --color-border: var(--color-border-dark);
  --color-input: var(--color-input-dark);
  --color-input-focus: var(--color-input-focus-dark);

  /* Spacing variables */
  --spacing-xs: 0.3125rem;
  --spacing-sm: 0.625rem;
  --spacing-md: 1.25rem;
  --spacing-lg: 2rem;

  /* Font sizes */
  --font-size-small: 0.8rem;
  --font-size-normal: 1rem;
  --font-size-large: 1.2rem;

  /* Other variables */
  --border-radius: 1.125rem;
  --transition-speed: 0.3s;
  --svg-filter: brightness(0) saturate(100%) var(--color-primary-filter);
  --color-primary-filter: invert(73%) sepia(17%) saturate(360%) hue-rotate(177deg) brightness(87%) contrast(85%);
}

/* Reset and Base Styles */
body,
html {
  background-color: var(--color-background);
  color: var(--color-text);
  font-family: "Rubik", Arial, Helvetica, sans-serif;
  width: 100%;
  height: 100%;
  min-width: 320px !important;
  min-height: 370px !important;
  margin: 0;
  padding: 0;
  overflow: hidden;
  position: fixed;
  -webkit-font-smoothing: antialiased; /* Improve font rendering */
  -moz-osx-font-smoothing: grayscale;    /* Improve font rendering */
}

body {
  overscroll-behavior: none;
  -webkit-overscroll-behavior: none;
}

body,
#left-panel,
#chat-input,
.message,
.config-button,
.switch-label {
  -webkit-transition: background-color 0.3s, color 0.3s, border-color 0.3s;
  transition: background-color 0.3s, color 0.3s, border-color 0.3s;
  color: var(--color-text);
}

/* Layout */
.container {
  display: -webkit-flex;
  display: flex;
  height: 100%;
}

.panel {
  display: -webkit-flex;
  display: flex;
  height: 100%;
  overflow: auto;
  -webkit-scroll-behavior: smooth;
  scroll-behavior: smooth;
}

/* Left Panel */
#left-panel {
  background-color: var(--color-panel);
  border-right: 1px solid var(--color-border);
  box-sizing: border-box;
  display: -webkit-flex;
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  -webkit-transition: all var(--transition-speed) ease-in-out;
  transition: all var(--transition-speed) ease-in-out;
  width: 250px;
  min-width: 250px;
  color: var(--color-text);
  box-shadow: 1px 0 5px rgba(0, 0, 0, 0.3);
  user-select: none;
}

#left-panel.hidden {
  margin-left: -250px;
}

.left-panel-top {
  flex: 1;
  display: -webkit-flex;
  display: flex;
  flex-direction: column;
  min-height: 0;
  overflow: hidden;
  margin-top: 3.5rem;
  padding: var(--spacing-md) var(--spacing-md) 0 var(--spacing-md);
}

.left-panel-top::-webkit-scrollbar {
  width: 0px;
}

.left-panel-top {
  scrollbar-width: none;
  -ms-overflow-style: none;
}

#status-section,
.config-section:not(#chats-section) {
  flex-shrink: 0;
}

.left-panel-bottom {
  position: relative;
  flex-shrink: 0;
}

/* Sidebar Toggle Button */
.toggle-sidebar-button {
  height: 2.6rem;
  width: 2.6rem;
  background-color: var(--color-background);
  border: 0.1rem solid var(--color-border);
  border-radius: var(--spacing-xs);
  color: var(--color-text);
  opacity: 0.8;
  cursor: pointer;
  left: var(--spacing-md);
  padding: 0.47rem 0.56rem;
  position: absolute;
  top: var(--spacing-md);
  z-index: 1004;
  -webkit-transition: all var(--transition-speed) ease-in-out;
  transition: all var(--transition-speed) ease-in-out;
}

.toggle-sidebar-button:hover {
  background-color: var(--color-secondary);
  opacity: 1;
}

.toggle-sidebar-button:active {
  opacity: 0.5;
}

#sidebar-hamburger-svg {
  -webkit-transition: all var(--transition-speed) ease;
  transition: all var(--transition-speed) ease;
}

.toggle-sidebar-button:active #sidebar-hamburger-svg {
  -webkit-transform: scaleY(0.8);
  transform: scaleY(0.8);
}

.switch-label {
  margin-right: 0.5rem;
}

/* Chats container */
.chat-container {
    display: flex;
    align-items: center;
    position: relative;
    width: 100%;
    min-height: 30px;
    gap: 0;
}

/* Update the chat-list-button padding to accommodate the vertical layout */
.chat-list-button {
    display: block;
    width: 100%;
    padding: 8px 5px;
    cursor: pointer;
    overflow: hidden;
    position: relative;
    border-radius: 4px;
    transition: background-color 0.2s ease-in-out;
}

/* Add some more padding to the list items to accommodate the vertical layout */
.chat-list-button.has-task-container {
    padding-top: 6px;
    padding-bottom: 6px;
}

/* Subtle background on hover for the entire row */
.chat-list-button:hover {
    background-color: rgba(255, 255, 255, 0.03);
}

.light-mode .chat-list-button:hover {
    background-color: rgba(0, 0, 0, 0.02);
}

.chat-name {
  display: inline-block;
  max-width: 160px;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
  cursor: pointer;
  padding: 3px 8px;
  border-radius: 4px;
  transition: background-color 0.2s;
  margin-right: 60px; /* Make space for buttons */
  font-size: var(--font-size-small); /* Match config button font size */
}

/* Add a nice hover effect to just the chat name */
.chat-name:hover {
  background-color: rgba(255, 255, 255, 0.1);
  text-decoration: none;
}

.light-mode .chat-name:hover {
  background-color: rgba(0, 0, 0, 0.05);
}

.chats-list-container {
  flex: 1;
  min-height: 0;
  overflow-y: auto;
  scroll-behavior: smooth;
  /* Mask */
  mask-image: linear-gradient(
    to bottom,
    black calc(100% - 20px),
    transparent 100%
  );
  -webkit-mask-image: linear-gradient(
    to bottom,
    black calc(100% - 20px),
    transparent 100%
  );
  /* Fallback for browsers that do not support mask-image */
  background: linear-gradient(to bottom, calc(100% - 20px), transparent 100%);
  /* Add padding to account for fade */
  padding-bottom: 20px;
  scrollbar-width: thin;
  -ms-overflow-style: auto;
}

.chats-list-container::-webkit-scrollbar {
  width: 5px;
}

.chats-list-container::-webkit-scrollbar-track {
  background: rgba(0, 0, 0, 0.2);
  border-radius: 6px;
}

.chats-list-container::-webkit-scrollbar-thumb {
  background-color: var(--color-border);
  border-radius: 6px;
}

.chats-list-container::-webkit-scrollbar-thumb:hover {
  background-color: var(--color-border);
}

/* Chats Section */
#chats-section {
  display: -webkit-flex;
  display: flex;
  flex-direction: column;
  min-height: 0;
  flex: 1;
  margin-top: 0.5rem;
}

/* Preferences */
.pref-header {
  display: -webkit-flex;
  display: flex;
  justify-content: space-between;
  align-items: center;
  cursor: pointer;
  user-select: none;
  font-size: var(--font-size-normal);
  margin: 0.28rem 0 0.6rem 0;
}

/* Arrow icon */
.arrow-icon {
  flex-shrink: 0;
  -webkit-transition: transform var(--transition-speed) ease-in-out;
  transition: transform var(--transition-speed) ease-in-out;
  margin-left: 0.5rem;
  width: 16px;
  height: 16px;
  transform: rotate(90deg);
}

.arrow-icon.rotated {
  -webkit-transform: rotate(-90deg);
  transform: rotate(-90deg);
}

.pref-section {
  font-size: var(--font-size-small);
  padding: 0.6rem var(--spacing-md) 0.05rem var(--spacing-md);
}

/* Collapse transition */
.pref-section [x-cloak] {
  display: none;
}

/* Version */
.version-info {
  line-height: 0.8rem;
  position: relative;
  margin: 0 var(--spacing-md) 1rem var(--spacing-md);
  padding-top: 10px;
  border-top: 1px solid var(--color-border);
}

/* Right Panel */
#right-panel {
  display: -webkit-flex;
  display: flex;
  width: 100%;
  flex-direction: column;
  flex-grow: 1;
  -webkit-transition: margin-left var(--transition-speed) ease-in-out;
  transition: margin-left var(--transition-speed) ease-in-out;
}

#right-panel.expanded {
  margin-left: 0;
}

#time-date-container {
  position: fixed;
  right: 0;
  display: flex;
  align-items: center;
  gap: var(--spacing-sm);
  margin-right: var(--spacing-md);
  margin-top: var(--spacing-md);
}

#time-date {
  color: var(--color-text);
  font-size: var(--font-size-normal);
  text-align: right;
  line-height: 1.1;
}

#user-date {
  font-size: var(--font-size-small);
  opacity: 0.6;
}

/* Typography */
h2,
h3 {
  color: var(--color-primary);
}

h2 {
  margin-bottom: var(--spacing-sm);
  margin-top: var(--spacing-lg);
}

h3 {
  margin-bottom: var(--spacing-sm);
}

h4 {
  margin: auto 0;
}

#a0version {
