  font-size: 0.7rem;
  user-select: all;
}

pre {
  font-family: 'Roboto Mono', monospace;
  font-optical-sizing: auto;
  -webkit-font-optical-sizing: auto;
  font-size: 0.75rem;
}

/* Chat History */
#chat-history {
  display: -webkit-flex;
  display: flex;
  flex-direction: column;
  flex-grow: 1;
  overflow-y: scroll;
  overflow-x: hidden;
  scroll-behavior: auto !important; /* avoid infinite scrolling! */
  padding: var(--spacing-md) var(--spacing-md) 0;
  -webkit-transition: all 0.3s ease;
  transition: all 0.3s ease;
  scrollbar-width: thin;
  scrollbar-color: #555 transparent;
}

#chat-history > *:first-child {
  margin-top: 4.4em;
}

/* Scrollbar styling for Firefox */
#chat-history::-webkit-scrollbar {
  width: 5px;
}

#chat-history::-webkit-scrollbar-track {
  box-shadow: inset 0 0 5px rgba(0, 0, 0, 0.3);
  border-radius: 3px;
}

#chat-history::-webkit-scrollbar-thumb {
  border-radius: 3px;
  box-shadow: inset 0 0 5px rgba(0, 0, 0, 0.3);
  background-color: #555;
  -webkit-transition: background-color var(--transition-speed) ease-in-out;
  transition: background-color var(--transition-speed) ease-in-out;
}

#chat-history::-webkit-scrollbar-thumb:hover {
  background-color: #666;
}

#chat-history::-webkit-scrollbar-thumb:active {
  background-color: #888;
}

/* Logo Container */
#logo-container {
  display: -webkit-flex;
  display: flex;
  align-items: center;
  justify-content: space-between;
  position: fixed;
  margin-left: 4.6rem;
  margin-top: var(--spacing-md);
  z-index: 1004;
  -webkit-transition: margin-left var(--transition-speed) ease-in-out;
  transition: margin-left var(--transition-speed) ease-in-out;
}

#logo-container a {
  color: inherit;
  text-decoration: none;
}

#logo-container img {
  border-radius: var(--spacing-xs);
  width: auto;
  height: 2.6rem;
  -webkit-transition: filter 0.3s ease;
  transition: filter 0.3s ease;
}

#progress-bar-box {
  background-color: var(--color-panel);
  padding: var(--spacing-sm) var(--spacing-md);
  padding-bottom: 0;
  display: flex;
  justify-content: space-between;
  z-index: 1001;
}

#progress-bar-h {
  color: var(--color-primary);
  display: flex;
  align-items: left;
  justify-content: flex-start;
  height: 1.2em;
  text-overflow: ellipsis;
  white-space: nowrap;       /* Added for text overflow */
  overflow: hidden;
  font-weight: normal;
}

#progress-bar-i {
  font-weight: bold;
  padding-right: 0.5em;
  color: var(--color-secondary);
}

.progress-bar h4 {
  margin-left: 1em;
  margin-right: 1.2em;
}

.shiny-text {
  background: linear-gradient(
      to right,
      var(--color-primary-dark) 20%,
      var(--color-text) 40%,
      var(--color-text) 60%,
      var(--color-primary-dark) 60%
  );
  background-size: 200% auto;
  color: transparent;
  -webkit-background-clip: text;
  background-clip: text;
  animation: shine 1s linear infinite;
}

#right-panel.expanded #logo-container {
  margin-left: 4.6rem;
}

/* Message Styles */
.message-container {
  animation: fadeIn 0.5s;
  -webkit-animation: fadeIn 0.5s;
  margin-bottom: var(--spacing-sm);
}

.message {
  background-color: var(--color-message-bg);
