  padding: 0.9rem var(--spacing-md) 0.7rem var(--spacing-md);
}

.user-container {
  align-self: flex-end;
  margin: var(--spacing-sm) var(--spacing-md);
}

.ai-container {
  align-self: flex-start;
}

.center-container {
  align-self: center;
  max-width: 80%;
  margin: 0;
}

.center-container .message {
  margin-bottom: var(--spacing-sm);
}

.message-user {
